.w3-flex {
  display: flex;
}

.w3-flex-full-center {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-between;
}

.w3-flex-hcenter {
  display: flex;
  justify-content: center;
}

.w3-multiline {
  flex-wrap: wrap;
}

.w3-vertical-flex-stretch {
  flex-grow: 1;
}

